const CAMBIO = 'https://economia.awesomeapi.com.br/json/all';

const FetchCambio = () => {
  fetch(CAMBIO).then((res) => res.json((json) => (
    res.ok ? Promise.resolve(json) : Promise.reject(json))));
};

export default FetchCambio;
